import{$ as e,a as i}from"./highlight-c6fe8555.js";import{$ as l}from"./codeblock-6ab1e2ba.js";var t=new window.nijor.component((async function(){return'<div style="display: none;" n-scope="yeRH2GhDeVl6u99HTzV4"><codellx n-scope="yeRH2GhDeVl6u99HTzV4"></codellx></div>\n    <sectionllx title="Structure of a Nijor project" n-scope="yeRH2GhDeVl6u99HTzV4">\n        When you use the <highlightllx n-scope="yeRH2GhDeVl6u99HTzV4">nijor create {appname}</highlightllx> command, it creates a new directory named after your project. This page is intended to help you understand the use of each of these directories and files.\n    </sectionllx>\n    <sectionllx title="app directory" n-scope="yeRH2GhDeVl6u99HTzV4">\n        The <highlightllx n-scope="yeRH2GhDeVl6u99HTzV4">app</highlightllx> directory contains the <highlightllx n-scope="yeRH2GhDeVl6u99HTzV4">index.html</highlightllx> file for our website. It also contains another directory called <highlightllx n-scope="yeRH2GhDeVl6u99HTzV4">assets</highlightllx> which stores our css file and it also contains another directory called <highlightllx n-scope="yeRH2GhDeVl6u99HTzV4">modules</highlightllx> which contains the js files produced by the compiler.\n    </sectionllx>\n    <sectionllx title="src directory" n-scope="yeRH2GhDeVl6u99HTzV4">\n        The <highlightllx n-scope="yeRH2GhDeVl6u99HTzV4">src</highlightllx> directory is our main working directory. We generally don\'t need to touch the <highlightllx n-scope="yeRH2GhDeVl6u99HTzV4">app</highlightllx> directory.\n    </sectionllx>\n    <sectionllx title="src/components directory" n-scope="yeRH2GhDeVl6u99HTzV4">\n        This directory stores all the reusable Nijor components.\n    </sectionllx>\n    <sectionllx title="src/pages directory" n-scope="yeRH2GhDeVl6u99HTzV4">\n        This directory stores all the Nijor components which are to be used as <highlightllx n-scope="yeRH2GhDeVl6u99HTzV4">pages</highlightllx> during routing. Pages are just normal Nijor components which are used for routing, they behave normally as other Nijor components.\n    </sectionllx>\n    <sectionllx title="src/styles directory" n-scope="yeRH2GhDeVl6u99HTzV4">\n        This directory stores our stylesheets.\n    </sectionllx>\n    <sectionllx title="src/images directory" n-scope="yeRH2GhDeVl6u99HTzV4">\n        This directory stores our images which can be imported into a Nijor component just like a Javascript file using ES6 imports.\n    </sectionllx>\n    <sectionllx title="src/App.js file" n-scope="yeRH2GhDeVl6u99HTzV4">\n        This file is the main entrypoint of our Nijor project.\n    </sectionllx>\n    <sectionllx title="src/App.nijor file" n-scope="yeRH2GhDeVl6u99HTzV4">\n        This file is like the index.html for Nijor. We still need to use the index.html file sometimes though. The template tag of App.nijor is like the body of the index.html file.\n    </sectionllx>\n    <sectionllx title="Nijor Configuration File" n-scope="yeRH2GhDeVl6u99HTzV4">\n        The <highlightllx n-scope="yeRH2GhDeVl6u99HTzV4">nijor.config.json</highlightllx> is a file which contains certain configurations for a Nijor project.<br n-scope="yeRH2GhDeVl6u99HTzV4">\n        If you try to run the <highlightllx n-scope="yeRH2GhDeVl6u99HTzV4">nijor build</highlightllx>,<highlightllx n-scope="yeRH2GhDeVl6u99HTzV4">nijor compile</highlightllx>,<highlightllx n-scope="yeRH2GhDeVl6u99HTzV4">nijor serve</highlightllx> commands inside a Nijor project without this file, then the <highlightllx n-scope="yeRH2GhDeVl6u99HTzV4">nijor-compiler</highlightllx> won\'t work and will throw errors.\n    </sectionllx>\n'}),(async function(){e.init("sectionllx"),await e.run(),i.init("highlightllx"),await i.run(),l.init("codellx"),await l.run()}));export{t as default};
